// index.js
import { createRouter, createWebHistory } from 'vue-router'; // Change imports
// Importation des composants
import Accueil from '@/pages/AcceuilPage.vue';
import Serveurs from '@/pages/ServeurPage.vue';

const routes = [
  {
    path: '/',
    name: 'Accueil',
    component: Accueil
  },
  {
    path: '/serveurs',
    name: 'Serveurs',
    component: Serveurs
  }
];

const router = createRouter({
  history: createWebHistory(), // Use createWebHistory() for history mode
  routes
});

export default router;
